import React from 'react';
import Task from './Task';
const TaskList = (props) => {
  console.log(props);
  const renderTasks = props.tasks.map((task) => {
    return (
      <Task
        task={task}
        key={task.id}
        title={task.title}
        timeStart={task.timeStart}
        timeEnd={task.timeEnd}
      />
    );
  });
  return <div>{renderTasks}</div>;
};

export default TaskList;
